import React from "react";
import { ThemeProvider } from "styled-components";
import { theme } from "./CommonStyle";

const Theme = ({ children }) => (
  <ThemeProvider
    theme={{
      primaryFont: "Arial",
      primaryColor: "#666",
      mainColor: "red",
      skyblue: "rgba(50, 175, 254)",
      ligthblue: "rgba(141, 212, 250)",
      pink: "rgba(251, 21, 84)",
      navy: "rgba(2, 17, 29)",
      green: "rgba(44, 188, 170)",
      ...theme,
    }}
  >
    {children}
  </ThemeProvider>
);
export default theme;
